// components/Home.js
import React from "react";
import pets from "../pets.png";

const Home = () => {
  return (
    <div>
      <h1>Welcome to our Pet Store!</h1>
      <img
        src={pets}
        style={{ width: "300px", height: "100px" }}
        alt="Pet Store"
      />
    </div>
  );
};

export default Home;
